k=B.CA.cp("# Die PreisRechner Formel\n\nUnsere Methode berechnet den Verkaufspreis eines Produkts, indem die variablen und fixen Kosten auf jede produzierte Einheit aufgeteilt werden und am Ende eine flexible Gewinnmarge aufgeschlagen wird. Dieses Verfahren eignet sich besonders gut f\xfcr kleine und mittlere Unternehmen (KMUs), die eine einfache und transparente Preisfindung ben\xf6tigen.\n\n## Grundlagen der Berechnung\n\nDie Methode basiert auf zwei Hauptkostentypen:\n\n1. Variable Kosten pro Einheit: Direkte Kosten, die spezifisch f\xfcr jedes Produkt anfallen (z. B. Material und Arbeitszeit).\n2. Fixkosten: Gemeinkosten, die nicht direkt einem Produkt zugeordnet werden k\xf6nnen (z. B. Miete, Verwaltung). Diese Kosten werden gleichm\xe4\xdfig auf alle Produkte verteilt.\n\n## Einfache Formel zur Berechnung des Selbstkostenpreises\n\nUm den Grundpreis oder Selbstkostenpreis eines Produkts zu berechnen, verwenden wir folgende Formel:\n\nSelbstkostenpreis = Variable Kosten pro Einheit + Fixkosten pro Einheit\n\nDabei ist:\n\n- Variable Kosten pro Einheit: Die direkten Kosten, die nur f\xfcr dieses spezielle Produkt anfallen.\n- Fixkosten pro Einheit: Der Anteil der Fixkosten, der auf jede hergestellte Einheit entf\xe4llt. Er wird berechnet, indem die gesamten Fixkosten durch die Gesamtproduktionsmenge geteilt werden.\n\n## Schritt-f\xfcr-Schritt-Berechnung\n\n1. Fixkosten pro Einheit berechnen:\n  Fixkosten pro Einheit = Gesamte Fixkosten / Gesamtproduktionsmenge\n2. Selbstkostenpreis berechnen:\n  Selbstkostenpreis = Variable Kosten pro Einheit + Fixkosten pro Einheit\n3. Gewinnmarge anwenden:\n  W\xe4hlen Sie die gew\xfcnschte Gewinnmarge (in Prozent) und f\xfcgen Sie sie hinzu, um den Verkaufspreis festzulegen:\n  Verkaufspreis = Selbstkostenpreis * (1 + Gewinnmarge / 100)\n\n## Beispielrechnung: Preisberechnung f\xfcr einen Schreibtisch mit Gewinnmarge\n\nStellen wir uns vor, ein Unternehmen stellt Schreibtische her und m\xf6chte den Preis pro Schreibtisch berechnen. Hier sind die gegebenen Daten:\n\n1. Variable Kosten pro Schreibtisch:\n  - Materialkosten: 30 \u20ac\n  - Arbeitskosten: 20 \u20ac\n  Variable Kosten pro Schreibtisch = 30 \u20ac + 20 \u20ac = 50 \u20ac\n2. Fixkosten des Unternehmens: 5.000 \u20ac pro Monat\n3. Produktionsmenge: 100 Schreibtische pro Monat\n\nSchritt 1: Berechnung der Fixkosten pro Schreibtisch\nFixkosten pro Schreibtisch = 5.000 \u20ac / 100 = 50 \u20ac\n\nSchritt 2: Berechnung des Selbstkostenpreises pro Schreibtisch\nSelbstkostenpreis = 50 \u20ac + 50 \u20ac = 100 \u20ac\n\nSchritt 3: Anwendung der Gewinnmarge\nAngenommen, das Unternehmen m\xf6chte eine Gewinnmarge von 20 % aufschlagen. Der Verkaufspreis berechnet sich dann wie folgt:\nVerkaufspreis = 100 \u20ac * (1 + 20 / 100) = 100 \u20ac * 1,20 = 120 \u20ac\n\n## Endergebnis\n\nDer Verkaufspreis des Schreibtischs bei einer 20 % Gewinnmarge betr\xe4gt 120 \u20ac.\n\n## Flexible Anpassung der Gewinnmarge\n\nMit dem Gewinnmargen-Regler kann der Verkaufspreis je nach gew\xfcnschter Marge flexibel angepasst werden:\n\n- 0 % Gewinnmarge (nur die Produktionskosten decken): 100 \u20ac\n- 10 % Gewinnmarge: 100 \u20ac \xd7 1,10 = 110 \u20ac\n- 50 % Gewinnmarge: 100 \u20ac \xd7 1,50 = 150 \u20ac\n- 100 % Gewinnmarge: 100 \u20ac \xd7 2,00 = 200 \u20ac\n\nDer Gewinnmargen-Regler erm\xf6glicht es dem Unternehmen, den Verkaufspreis f\xfcr den Schreibtisch dynamisch an verschiedene Gewinnziele anzupassen.\n\n## Zusammenfassung\n\nDie FDC-Methode mit einem Gewinnmargen-Regler bietet eine einfache und effiziente M\xf6glichkeit, die Gesamtkosten eines Produkts zu berechnen und dabei eine gew\xfcnschte Gewinnspanne zu ber\xfccksichtigen. Diese Methode stellt sicher, dass alle Kosten gedeckt sind und flexibel an Marktbedingungen und Unternehmensziele angepasst werden k\xf6nnen.        ")
